css:
@-moz-document domain('trexbox.com'), url-prefix('http://www.trexbox.com/forums/') {
	

A A:link { font-family: Arial; font-weight: normal; font-style: normal; text-decoration: none; font-variant: normal; font-size: medium; }

A A:hoover { font-family: Arial; font-weight: normal; font-style: italic; text-decoration: none; font-variant: normal; font-size: medium; }

